    "2016-09-15T07:55:42.171086",nt"name": "nycdcp-manhattan-bike-count-locations",nt"isopen":
    false,nt"url": null,nt"notes": "The Transportation Division of the New
    York City Department of City Planning (NYCDCP) has performed annual bike counts
    in Manhattan since 1999. The counts have been conducted along designated bicycle
    routes at 10 on-street and 5 off-street locations during the fall season. These
    locations have remained generally consistent. The data collected includes cyclist/user
    volumes, helmet usage, use of bike lane, gender, etc. The bike counts data can offer
    insights into the overall trends in user demographics and travel patterns over time.",nt"license_title":
